import { Link } from 'react-router-dom';
import Mypage from './mypage';
import Navigation from '../routes/navigation';

const ProjectList = () => {
  return (
    <div>
      <Navigation/>
      <h1>Project List Page</h1>
      <Link to='./mypage'>Mypage</Link>
    </div>
  );
};

export default ProjectList;
